import React from "react";
import ReactDOM from "react-dom";

const num = 7;
const fname = "mac";
const lname = "muka";

ReactDOM.render(
  <div>
    <h1>My Favorite Food</h1>
    <ul>
      <li>Food 1</li>
      <li>Food 2</li>
      <li>Food 3</li>
    </ul>
    <h1>
      Hello {fname} {lname}
    </h1>
    <p>Your lucky number is {num}</p>
  </div>,
  document.getElementById("root")
);
